from requests_html import HTMLSession
from bs4 import BeautifulSoup as bs  # importing BeautifulSoup
import json

origin = "PmWQmZXYd74"
exclude = "jJmift7NrSk"  # this is the merch video linked from the end, stop here.
base_url = "https://www.youtube.com/watch?v="


def get_links(vid_id):
    session = HTMLSession()
    response = session.get(base_url + vid_id)
    response.html.render(sleep=3, wait=0)

    soup = bs(response.html.html, "html.parser")
    links = [div.a["href"] for div in soup.find_all("div", class_="ytp-ce-element")]

    for link in links:
        if not link.startswith(base_url):
            print("Got bad link: " + link)

    links = [
        link.split(base_url)[1].split("&")[0]
        for link in links
        if link.startswith(base_url)
    ]

    view_count = soup.find("meta", itemprop="interactionCount")["content"]
    name = soup.find("meta", itemprop="name")["content"]
    duration = soup.find("meta", itemprop="duration")["content"]
    author = soup.find("span", itemprop="author").find("link").attrs["href"]
    if author != "http://www.youtube.com/@CGPGrey":
        print("Got Bad Author: " + author)
        return "ignore"

    try:
        description = (
            soup.find("ytd-expandable-video-description-body-renderer")
            .find("ytd-expander")
            .find("div")
            .find("yt-attributed-string")
            .get_text()
        )
        code = description.split("\n")[-1]
    except AttributeError:
        code = "Failed"

    return {
        "id": vid_id,
        "views": view_count,
        "name": name,
        "duration": duration,
        "links": links,
        "code": code,
        "url": base_url + vid_id,
    }


